import React from "react";
import { Image, Grid, Dropdown, Menu } from "semantic-ui-react";
export default function brands() {

    const options = [
        { key: 1, text: 'Choice 1', value: 1 },
        { key: 2, text: 'Choice 2', value: 2 },
        { key: 3, text: 'Choice 3', value: 3 },
      ]



      const friendOptions = [
      
        {
          key: 'Christian',
          text: 'Christian',
          value: 'Christian',
        },
        {
          key: 'Matt',
          text: 'Matt',
          value: 'Matt',
        },
        {
          key: 'Justen Kitsune',
          text: 'Justen Kitsune',
          value: 'Justen Kitsune'
        },
      ]
      
  return (
    <div>
      <Image src="images/markalar.PNG" size="massive" centered />
      <br />

      <Grid>
        <Grid.Column width={4}>
        <Dropdown
      placeholder='I open on focus'
      openOnFocus
      selection
      options={friendOptions}
    />
        </Grid.Column>
        <Grid.Column width={12}>
          <Image src="images/markalar.PNG" centered />
        </Grid.Column>
      </Grid>
    </div>
  );
}
